import * as docx from "docx";
import { Packer, Paragraph } from "docx";

export const wordImage = (images: any[]) => {
	// 定义九宫格的行数和列数
	const rows = 3;
	const cols = 3;


	// 定义单元格的背景颜色
	const cellColor = "cccccc";


	const defaultMargin = {
		top: 200,
		bottom: 200,
		right: 200,
		left: 200,
	};

	// 创建表格
	const table = new docx.Table({
		width: {
			size: 100,
			type: docx.WidthType.PERCENTAGE,
		},
		borders: {
			top: { size: 0, style: docx.BorderStyle.NONE },
			bottom: { size: 0, style: docx.BorderStyle.NONE },
			left: { size: 0, style: docx.BorderStyle.NONE },
			right: { size: 0, style: docx.BorderStyle.NONE },
		},
		// height: {
		// 	size: tableHeight,
		// 	type: docx.HeightType.DXA,
		// },
		rows: Array.from({ length: rows }, () =>
			new docx.TableRow({

				children: Array.from({ length: cols }, () =>
					new docx.TableCell({
						shading: {
							fill: cellColor,
						},
						margins: defaultMargin,
						children: [new Paragraph({
							children: [
								new docx.ImageRun({
									data: `data:image/jpeg;base64,`,
									transformation: {
										width: 160,
										height: 160,
									}
								})
							]
						})],
					})
				),

			})
		),
	});



	const doc = new docx.Document({
		sections: [
			{ children: [table] }
		]
	})

	Packer.toBlob(doc).then(blob => {
		const url = window.URL.createObjectURL(blob);
		const link = document.createElement('a');
		link.href = url;
		link.download = "example.docx";
		// 添加链接到DOM
		document.body.appendChild(link);

		// 触发下载
		link.click();

		// 释放URL对象
		window.URL.revokeObjectURL(url);
	})
}
